I'm just saying you are special casing it to work on a `uint8_t`, the check wouldn't work for any larger integer type.

```
using PayloadSize = std::uint8_t;
if (data.size() < sizeof(PayloadSize))
{
    return ::ipmi::responseReqDataLenInvalid();
}
PayloadSize payloadSize = data[0];
auto payload = data.subspan(1, payloadSize);
```

You could also use `stdplus::extract()`, which can check the size and pull the data off the front, resizing the span in the process.
```
#include <stdplus/raw.hpp>
#include <stdplus/numeric/endian.hpp>

std::uint8_t payloadSize;
try
{
    payloadSize = stdplus::extract<stdplus::EndianPacked<decltype(payloadSize), std::endian::little>>(data);
}
catch (...)
{
    return ::ipmi::responseReqDataLenInvalid();
}
// data is now payload
```
